import React from 'react';
import Pagination from 'react-bootstrap/Pagination';

function pager(props){

    return(
        <div>
            <Pagination>
                <Pagination.Prev />
                <Pagination.Item active >{props.first}</Pagination.Item>
                <Pagination.Next />
            </Pagination>
        </div>
    );

}

export default pager;
